  \"2016-07-27T22:52:16.370969\",\n\t\"name\": \"mark-twain-national-wildlife-refuge-calhoun-district-annual-narrative-report-calendar-ye-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mark Twain
  National Wildlife Refuge outlines Refuge accomplishments during the 1981 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Refuge administration is outlined; information about personnel, funding, safety,
  and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, forests, croplands, fire management, and pest control. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, and game mammals. The
  public uses of the Refuge described in this report include interpretive programs,
  fishing, and law enforcement. The equipment and facilities section of the report
  provides information about new construction, rehabilitation, equipment replacement,
  and energy conservation. Cooperative programs are provided at the end.\",\n\t\"license_title\":
